  import React from 'react'
  import { MDXTag } from '@mdx-js/tag'
  import { Playground, PropsTable } from 'docz'
import { NewDocs } from './New'

export default class MDXContent extends React.Component {
  constructor(props) {
    super(props)
    this.layout = null
  }
  render() {
    const { components, ...props } = this.props

    return <MDXTag
             name="wrapper"

             components={components}>
<MDXTag name="h1" components={components} props={{"id":"new"}}>{`New`}</MDXTag>
<MDXTag name="p" components={components}>{`Thats the new component`}</MDXTag>
<PropsTable of={NewDocs} />
           </MDXTag>
  }
}
